import React from 'react';
import './Facing.css';

const Facing = (props) => {
console.log(props)
const facing = props.facing 
var prodImage
try{
  prodImage = require('../imgs/'+ facing.productUPC+'.png')

}catch(err){
  prodImage = require('../imgs/blackbox.png')
  console.log("image not found error trapped")
}

return (

    <li className="facing-info">
    <h3 className="facing-info__shelf">
      {'sID:'+ facing.shelfID}
    </h3>

     <img  
         className="facing-info__upc" 
         src={prodImage} 
         alt = 'ProductImg'
     />

    <p  className="facing-info__gondola">
      {"Gond:"+ facing.displayfixtureID}
    </p>
    </li>
);




};
export default Facing;
